import React from 'react'
import styled from 'styled-components'
const Navbar = styled.div`
    display: flex;

    justify-content: flex-end;
    align-items: center;
    margin-bottom: 3rem;    
    background-color:blue;
`
const Nav = () => {
    return (
        <div>
            <Navbar></Navbar>
        </div>
    )
}

export default Nav
